const SpeedMeasurePlugin = require('speed-measure-webpack-plugin'); // \u5F15\u5165webpack\u6253\u5305\u901F\u5EA6\u5206\u6790\u63D2\u4EF6
const { BundleAnalyzerPlugin } = require('webpack-bundle-analyzer'); // \u5F15\u5165\u5206\u6790\u6253\u5305\u7ED3\u679C\u63D2\u4EF6
const { merge } = require('webpack-merge'); // \u5F15\u5165\u5408\u5E76webpack\u914D\u7F6E\u65B9\u6CD5

